import React, { Component } from 'react';
import classes from './Home.module.css';

class Home extends Component {
    render() {
        return(
            <div className = {classes.Home}>
                <p>Home page</p>
                <div className = {classes.AuthorizationForm}>
                    <p>Fuck it!</p>
                </div>
            </div>
        );
    }
}

export default Home;
